import React, {Component} from 'react';
import axios from 'axios';
import { getUrl, getStatic, getAdditionalHeaders, checkLogin} from './utilities';
var kk = {
    margin : "-10px"
        }
var lk = {
    height : "100%"
}

export default class Home extends React.Component {
    constructor(props){
        super(props);
        this.state = {};
    }

    getuserdata = () => {
        fetch(getUrl('/data/user/get/'), {headers: getAdditionalHeaders()})
            .then(response => {
                response.json()
                .then(data => {
                    console.log(response)
                    console.log(data)
                })
            })
            .catch(function(error){
                console.log(error);
            });
    }

    async componentWillMount() {
        this.setState({
            isLoggedIn: await checkLogin()
        });
    }

    render() {
        if(this.state['isLoggedIn']){
            return  (<div style={lk}><center> <img src={getStatic("/index.png")} width="30" height="30" style={kk}/> &nbsp;&nbsp;&nbsp; Instagram &nbsp; &nbsp; &nbsp;&nbsp;
            <div>
            <input class="input is-primary" type="text" placeholder="search"/> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;

            </div>
            <a><img src={getStatic("/images.png")} onClick={this.getuserdata} width="30" height="30" style={kk}/></a></center>
            </div>
            );    
        }   else    {
            // Redirect To Login
            return (<div>You are not logged in</div>);
        }

    } 
}
